import {Card, CardHeader, CardContent, Typography} from '@material-ui/core';

import MonetizationOnIcon from '@material-ui/icons/MonetizationOn';

export default function Kpi1() {
    return (
        <Card >
            <CardHeader
                avatar={
                    <MonetizationOnIcon />
                }
                titleTypographyProps={{ variant: 'h5' }}
                style={{ textAlign: "left", backgroundColor: "#55ae59", color: "white", fontSize }}
                title="Today Sales"
            />
            <CardContent>
                <Typography variant="h5">30 for $1,117.68</Typography>
            </CardContent>
        </Card>
    )
}
